import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav, NavItem, NavDropdown, MenuItem, Button, Form, FormControl} from 'react-bootstrap';


function App() {
  return (
    <div className="App">
      <Navbar bg="light" expand="lg">
        <Navbar.Brand href="#home">EmPoweringKnowledge</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="#home">About</Nav.Link>
            <Nav.Link href="#link">Representatives</Nav.Link>
            <Nav.Link href="#link">States</Nav.Link>
            <Nav.Link href="#link">Energy Bills</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
      <header className="App-header">
          EmPoweringKnowledge offers information on different types of energy consumption in each state, 
          in combination with Congress membersâ€™ sponsorship and voting for energy-related bills.
        
      </header>
    
      
    </div>
  );
}

export default App;
